import 'bootstrap/dist/css/bootstrap.css';

export default function Datatable ({data}) {
    const newdata = data.results
    const columns = newdata[0]
    console.log(columns)
    return(
        <table>
            <tr>
                {columns.map(heading => <th>{heading} </th>)}
            </tr>

        </table>
    )

}


ReactDOM.render(
    <Datatable />, document.getElementById('root')

);

